css:
@-moz-document domain(market.csgo.com) {

body {
    background: #333;
}

.warning-message {
    background: #292929 url(https://market.csgo.com/images/common/warning-message.png) repeat-x 0 0;
}

.selectionname {
    color: #dcdcdc;
}

.market-items .item .image {
    background-color: #5d5d5d;
}

.f-paytype {
    background-color: #828282;
}

.fixheightblock.toggler .toggleblock {
    border: 3px solid #555;
    background-color: #555;
}

.formpart dt span {
    color: #000000;
}

[class^="notice-"] {
    color: #000000;
}

.formpart dt span a {
    color: #000000;
}

.usm {
    background-color: #5d5d5d;
    color: #ffffff;
}

.marketuseful, .blueicon {
    color: #383838;
    background-color: #5d5d5d;
}

.fixheightblock header {
    background-color: #444444;
}

.marketsup-head {
    color: #000000;
}

.fixheightblock header b {
    color: #000000;
}

.marketsup {
    background-color: #444444;
}



.sortby span {
    color: #dcdcdc;
}

.sortby > .right {
    background-color: #333;
}

.chat__messages {
    box-shadow: inset 0px 0px 15px 0px rgb(0 0 0 / 24%);
}

.chat {
    background: #333;
    color: #000;
    border: 1px solid #aaa;
}

.sortby {
    background-color: #333333;
}

.menu-left {
    background-color: #101010;
}

.headline {
    padding: 10px 12px;
    background-color: #444444;
    color: #000000;
}

.headline > .right {
    background-color: #444;
}



a {
    color: #d6d6d6;
}

.wcommunity_post_date {
    color: #d6d6d6;
}

html, body {
    color: #000000;
}

#new-ticket-wrapper {
    background-color: #8a8a8a !important;
    border: 1px solid #8e8e8e !important;
}

.ticket-body-bottom {
    background: #333 !important;
}

.ticket-answers {
    background: #333333 url(https://i.ibb.co/qyN6NP0/back-pattern.png) 0px 0px repeat;
}

#new-ticket-wrapper {
    background-color: #727272 !important;
    border: 1px solid #727272 !important;
}

#faq-checkbox-label a {
    color: #335c73;
}

.table-v1.td-regular tr:nth-child(2n) td, .table-v2.td-regular tr:nth-child(2n) td {
    background-color: #5f5f5f;
}

.table-v1 td, .table-v2 td {
    background-color: #9a9a9a;
    color: #383838;
    border-right: 1px solid rgba(255, 255, 255, 0.5);
}

.table-v2, .tr-special td {
    background-color: #424242;
    color: #ce0000;
}

.outsumm {
    background: #444;
    border: 1px solid #f8ffe4;
}
    
.commonmenu {
    background: #444444;
    }
    
.confirmation-captcha, .confirmation-argee, .confirmation-password {
    border: 1px solid #ccc;
    background: #444;
}

.content > section > .right h3, .content > section .admin-content > .right h3 {
    color: #bbb;
}


a {
    color: #4788c7;
}

.wcommunity_post_date {
    color: #4788c7;
}

body.csgo-market .howitworks-term {
    background-color: #4a4a4a;
}

body.csgo-market .howitworks-term:nth-child(2n) {
    background-color: #ababab;
}

div#main {
    background-color: #444!important;
}

.sortby {
    background-color: #191919;
}
}
